import React from "react";
import { NavLink } from "react-bootstrap";
import s from "./Login.module.css";

const Login = () => {
    return (
        <div className = {s.row}>
            <div className = {s.col_6}>
            <li className={s.item}>
              <h5 className = {s.logo}>
                  Craft Cuts</h5>
              <h5 className = {s.h5welcome}>Добро пожаловать в <span className = {s.craftcuts_red}>Craft Cuts</span></h5>
              </li>
            </div>
            <div className = {s.col_6}></div>
        </div>
    );
}

export default Login;
